                </div>

                <div id='row2'>
                    <div className='column'><News /></div>
                    <div className='column'><Notes /></div>
                </div>

                <LoginPage />
*/

//Main App layout
class App extends React.Component {
    render() {
        return (
            <div>
                <div>

                    <TopHeader />
                <div id='row1'>
                    <div className='column'><Schedule /></div>
                    <div className='column'><Phone /></div>
                </div>

                <div id='row2'>
                    <div className='column'><News /></div>
                    <div className='column'><Notes /></div>
                </div>


                </div>

            </div>
        )
    }
}

export default App;
